script: |
  super -f text -I q5319.spq | sort > q5319.out

inputs:
  - name: q5319.spq
    data: |
      SELECT CAST ( + - col2 AS INTEGER ) * + ( col2 ) * col0 + - CAST ( - + col2 AS REAL ) AS col0 FROM tab2 (FORMAT parquet) WHERE + col1 + col2 IS NULL;
  - name: tab2

outputs:
  - name: q5319.out
    data: |
